import ExpenseItem from "./ExpenseItem";


export default function Expenses(props) {
    return (
        <div>
            {props.expenses.forEach((expense) => <ExpenseItem name={expense.title} amount={expense.amount} date={expense.date}/>)}
        </div>
    );
}
